ull_name\":\"\\u0535\\u0570\\u04bd \\u04bd\\u056a\\u0574\\u03f2\\u0251\\u0535\\u04bd\\u056a \\u13acm\\u13e2\\u13aat\\u0266\",\"is_private\":false,\"profile_pic_url\":\"https:\\/\\/scontent-mia3-1.cdninstagram.com\\/vp\\/c81424da30d992e85c15a7a4d67acb5c\\/5DC02895\\/t51.2885-19\\/11809746_895080163908886_564261466_a.jpg?_nc_ht=scontent-mia3-1.cdninstagram.com\",\"friendship\":false},\"has_liked\":false,\"caption\":\"Reposted from @moonomens -  Drop \\u2764\\ufe0f if you\\u2019re grateful, blessed & welcome more blessings into your life!\\n#moonomens @idillionaire - #regrann\"},\"2088768962564200794\":{\"type\":\"hashtag\",\"pk\":\"2088768962564200794\",\"id\":\"2088768962564200794_1676754961\",\"media_type\":8,\"code\":\"Bz8zE3_gBla\",\"image\":\"https:\\/\\/scontent-mia3-1.cdninstagram.com\\/vp\\/0596d8fb1d1a50608b8bdc4e5a217ff8\\/5DA6384A\\/t51.2885-15\\/e35\\/67292971_130330871541911_6406799138327489985_n.jpg?_nc_ht=scontent-mia3-1.cdninstagram.com&se=7&ig_cache_key=MjA4ODc2ODk1OTg4ODQ1NzE5Nw%3D%3D.2\",\"user\":{\"type\":\"hashtag\",\"full\":false,\"pk\":\"1676754961\",\"username\":\"aleksandar.hype\",\"full_name\":\"Aleksandar \\u0106.\",\"is_private\":false,\"profile_pic_url\":\"https:\\/\\/scontent-mia3-1.cdninstagram.com\\/vp\\/85d4ec83c6cf15c86ae1376eca1abfc7\\/5DC8B977\\/t51.2885-19\\/s150x150\\/66416636_497835667711998_9158123091262439424_n.jpg?_nc_ht=scontent-mia3-1.cdninstagram.com\",\"friendship\":false},\"has_liked\":false,\"caption\":\"I\'m so close to the dream that I can\'t go to sleep..\\n.\\n.\\n#music #trap #shooting #rap #hiphop #photographer #positivevibesonly #instapic #followforfollowback #likeforfollow #likeforlikes #photography #photooftheday #instagood #red #instastyle #hat #trapmusic #musician\"},\"2084114229909933594\":{\"type\":\"hashtag\",\"pk\":\"2084114229909933594\",\"id\":\"2084114229909933594_8265827452\",\"media_type\":1,\"code\":\"BzsQtmZHk4a\",\"image\":\"https:\\/\\/scontent-mia3-1.cdninstagram.com\\/vp\\/6008953fc2669cb72525b6d65ebca96b\\/5DB2820B\\/t51.2885-15\\/e35\\/61276747_715614622225202_4771443159877175503_n.jpg?_nc_ht=scontent-mia3-1.cdninstagram.com&se=7&ig_cache_key=MjA4NDExNDIyOTkwOTkzMzU5NA%3D%3D.2\",\"user\":{\"type\":\"hashtag\",\"full\":false,\"pk\":\"8265827452\",\"username\":\"universewizard\",\"full_name\":\"Brooke \\ud83e\\uddff\\ud83c\\udf08\\u2728\\ud83d\\udd2e\\ud83d\\udd2b\",\"is_private\":false,\"profile_pic_url\":\"https:\\/\\/scontent-mia3-1.cdninstagram.com\\/vp\\/311c2511a3c8d794c0f8ff23024bf788\\/5DC13BC9\\/t51.2885-19\\/s150x150\\/61307305_346496166051389_6838480317766959104_n.jpg?_nc_ht=scontent-mia3-1.cdninstagram.com\",\"friendship\":false},\"has_liked\":false,\"caption\":\"Ah, Mercury retrograde is upon us again as of yesterday, and I\'m sure most of you guys are already seeing the effects of it! (I\'ve already had to say goodbye to a laptop unfortunately). While with most Mercury retrogrades we think of the gloom and doom of our lives falling apart because of stagnation and miscommunication, this one has a way different vibe to it and you know what? I\'m actually digging it. I never thought i\'d ever say these words, but this retrograde couldn\'t have come at a better time! We\'ve all been working through a LOT in these past couple of months, especially recently, and I think we can all agree that we need a god damn rest. Don\'t get me wrong, you\'ll still come across regular challenges and frustrations that this transit brings, but this is mainly about rest and learning how to implement what we\'ve learnt PROPERLY. This Mercury retrograde gives us the opportunity to catch our breath and figure out what the hell has been going on these past couple of months. You probably feel like you\'ve learnt a lot, but they\'re not fully formed habits or 100% clear ideas in your life just yet, so we\'re now going to pick up the missing pieces and bridge it all together so we can heal it for good. The only way we can do all this work is if we\'re forced to revise and reconsider everything that we\'ve learnt and change things where need be. With this retrograde happening mostly in Cancer, you bet your ass we\'re gonna centre in on self love and our compassion for those around us. Expect your boundaries to be at the forefront of your mind during this transit too. You\'ll probably find yourself thinking about certain things from your past which could catch you off guard or bring up old issues you may have forgotten about, but this is just the usual Mercury retrograde process so feel it out and let it go. Forgive whatever problems confront you during this time and continue to put the work in everyday when it comes to your mindset and healing. Continue to establish your space in this world and let go of any attachments that are still lingering. Things may feel slow for a while, but that\'s okay! We got this. It\'s time to see the truth that we\'ve been missing.\"},\"2081914106261957365\":{\"type\":\"hashtag\",\"pk\":\"2081914106261957365\",\"id\":\"2081914106261957365_8265827452\",\"media_type\":1,\"code\":\"Bzkcdlknmr1\",\"image\":\"https:\\/\\/scontent-mia3-1.cdninstagram.com\\/vp\\/fdbc01483281cfb47433ededbb23cb46\\/5DACD9B9\\/t51.2885-15\\/e35\\/66413664_474433013314855_8578592249729925105_n.jpg?_nc_ht=scontent-mia3-1.cdninstagram.com&se=7&ig_cache_key=MjA4MTkxNDEwNjI2MTk1NzM2NQ%3D%3D.2\",\"user\":{\"type\":\"hashtag\",\"full\":false,\"pk\":\"8265827452\",\"username\":\"universewizard\",\"full_name\":\"Brooke \\ud83e\\uddff\\ud83c\\udf08\\u2728\\ud83d\\udd2e\\ud83d\\udd2b\",\"is_private\":false,\"profile_pic_url\":\"https:\\/\\/scontent-mia3-1.cdninstagram.com\\/vp\\/311c2511a3c8d794c0f8ff23024bf788\\/5DC13BC9\\/t51.2885-19\\/s150x150\\/61307305_346496166051389_6838480317766959104_n.jpg?_nc_ht=scontent-mia3-1.cdninstagram.com\",\"friendship\":false},\"has_liked\":false,\"caption\":\"WHAT ELSE CAN WE EXPECT FROM MARS IN LEO?\\n- 4 of Pentacles, Knight of Swords Rx, The Lovers & 9 of Wands Rx - \\nEverything is about to ramp up a hell of a lot more when it comes to getting to know ourselves and learning how to listen to our intuition over ego. Has life been feeling more overwhelming than usual lately? Feel like you can\'t even find a moment to let yourself think or breathe? Yeah, as annoying as it is this is for a reason. We aren\'t gonna establish any boundaries without being pushed to the absolute edge first, and with Mars in Leo... we\'ll be quick to act on this. This transit might really get under your skin at first because it\'s pushing you to withdraw from all these influences that are sucking the energy out of you every single day. It\'s intense, but it needs to be in order to push us into the next phase. We know what we want out of our relationships, we know how we want to be treated and we know exactly what boundaries we want to enforce, so it\'s time to start implementing all that. With Mercury retrograde also on the horizon, these two will really be working hand in hand to bring you challenges and frustrations to sort all this out once and for all. Sometimes, we really need to be angered and kicked while we\'re down in order to step up and become the ruler of our own kingdom rather than giving our power away to others. It gets to a point where you can only take so much disrespect off others, but we\'re also seeing how we\'ve let that play out due to lack of self respect and boundaries. This will be a time of trying to hold on but having no other choice left but to leave or detach because we deserve so much more than this. It\'s time to learn the hard way that most things are out of our control, and all we can do is choose to love and care for ourselves when things come to an end or we\'re forced to separate ourselves. These frustrations will continue to hinder your energy and everything you\'re putting out into the world until you learn how to get this all under control. Until then, expect to grow more tired and angry each day, expect to want to explode, and most importantly, expect profound change to come from all of these negative energies.\"},\"2080433759372359670\":{\"type\":\"hashtag\",\"pk\":\"2080433759372359670\",\"id\":\"2080433759372359670_8265827452\",\"media_type\":1,\"code\":\"BzfL3tGHrf2\",\"image\":\"https:\\/\\/scontent-mia3-1.cdninstagram.com\\/vp\\/0ad4632e72df2e460c7c464db94a7a5e\\/5DC840DC\\/t51.2885-15\\/e35\\/64855123_1473399122799114_2384969535889531677_n.jpg?_nc_ht=scontent-mia3-1.cdninstagram.com&se=7&ig_cache_key=MjA4MDQzMzc1OTM3MjM1OTY3MA%3D%3D.2\",\"user\":{\"type\":\"hashtag\",\"full\":false,\"pk\":\"8265827452\",\"username\":\"universewizard\",\"full_name\":\"Brooke \\ud83e\\uddff\\ud83c\\udf08\\u2728\\ud83d\\udd2e\\ud83d\\udd2b\",\"is_private\":false,\"profile_pic_url\":\"https:\\/\\/scontent-mia3-1.cdninstagram.com\\/vp\\/311c2511a3c8d794c0f8ff23024bf788\\/5DC13BC9\\/t51.2885-19\\/s150x150\\/61307305_346496166051389_6838480317766959104_n.jpg?_nc_ht=scontent-mia3-1.cdninstagram.com\",\"friendship\":false},\"has_liked\":false,\"caption\":\"At the start of the week, Mars decided to dance his way into the fiery and confident sign of Leo. Mars rules our strength, energy and how we choose to take action in the world, so it being in Leo for the next month and a half will really push us to establish our place in this world and take up as much space as we want! Things feel super up in the air right now, but Mars in Leo is here to help us  go for whatever we have our eyes set on or that we\'ve been too scared to chase previously. It gives us the strength to follow our hearts even if everything else in this world is against us. Usually this transit would really be firing us up, but with all the Cancer energy and a mercury retrograde around the corner, it\'s here to help us feel sane and stable, while giving the confidence we need to just push through and detach from things that don\'t serve us in a positive way. It\'s all about us now, not anyone else or what we can do to serve them. Our focus now is on how we can serve and respect OURSELVES enough to let go of what we\'ve been wrapped up in. It\'s time to make room in your life, for the new blessings, fun times and joy just waiting to come in, and there\'s no better transit to help us clear out all this crap! We don\'t want to stay behind the shadows anymore, we want to be noticed and it\'s time to work towards that. Leo energy doesn\'t give us a choice when it comes to how we want to live life, it\'s either follow your heart, or be unbearingly held down. So take this courage and learn to follow your heart, but don\'t forget to check yourself when you can feel your ego seeping through and projecting onto your passion. This transit isn\'t about chasing fame or being overbearing towards others because you\'re in the spotlight now, it\'s about integrating everything we\'ve learnt lately with our emotions and close relationships and use it to fuel your motivation and purpose. Ruling your own life from the goodness of your heart is completely different than ruling from an overactive ego or to the detriment of those around you. All you have to do now is keep that ego in check, and go head first into your goals. Run as far out of that comfort zone as you can!\"},\"2088872919037351570\":{\"type\":\"hashtag\",\"pk\":\"2088872919037351570\",\"id\":\"2088872919037351570_681946526\",\"media_type\":1,\"code\":\"Bz9KtpAJ5aS\",\"image\":\"https:\\/\\/scontent-mia3-1.cdninstagram.com\\/vp\\/0044684ca675015ad8d6448f3c308cfa\\/5DC19D8F\\/t51.2885-15\\/e35\\/67188228_551145522086274_644518199480102803_n.jpg?_nc_ht=scontent-mia3-1.cdninstagram.com&se=7&ig_cache_key=MjA4ODg3MjkxOTAzNzM1MTU3MA%3D%3D.2\",\"user\":{\"type\":\"hashtag\",\"full\":false,\"pk\":\"681946526\",\"username\":\"thelifebalanceteam\",\"full_name\":\"The Life Balance Team\",\"is_private\":false,\"profile_pic_url\":\"https:\\/\\/scontent-mia3-1.cdninstagram.com\\/vp\\/48ba1fe99589af7d5b103904ebc24494\\/5DB268B0\\/t51.2885-19\\/s150x150\\/29417357_2038859206379265_6441511089191518208_n